    <BrowserRouter>
            <Navbar />
            <Routes>
                <Route path='/about' element={<About />} />
                <Route path='/posts' element={<Posts />} />
                <Route path="/error" element={<Error />} />
                <Route path="/*" element={<Navigate to="/error" replace />} />
            </Routes>
      </BrowserRouter>
  )
}

export default App;
